/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import right from '../image/list/right.png';
import '../share.css';
import Item from './ListItem';
export default class List extends React.Component {
    render(){
        return(
            <div className="cm-item cm-jc-sb">
                {this.props.children}
        </div>
        )
    }
}
List.Item = Item;
